import React from 'react';
import MainNavigation from '../components/MainNavigation';

export default function Error() {
  return (
    <>
        <MainNavigation />
        <main>
            <h1>An Error ocurred!</h1>
            <p>Could not find this page.</p>
        </main>
    </>
  )
}
